import style from "./Nav.module.css";
import Container from "react-bootstrap/Container";
import Navs from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";
import logoNav from "../../resources/logoNav.png";
import { Button, Image, NavLink } from "react-bootstrap";
import { Link } from "react-router-dom";

const Nav = () => {
  return (
    <Navbar fixed="top" bg="white" variant="light" className={style.nav}>
      <Container>
        <Navbar.Brand href="/">
          <Image className={style.logo} src={logoNav} />
        </Navbar.Brand>
        <Navbar.Collapse className="justify-content-end">
          <Navs className="me-auto">
            <Navs.Link href="/home">Home</Navs.Link>
            <Navs.Link href="/about">About</Navs.Link>
            <Navs.Link href="/favorites">Favorites</Navs.Link>
          </Navs>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default Nav;
